INSERT INTO `news_articles` VALUES (8,'Car Crash-Test Dummies Move Beyond Young, Thin and Male','The University of Michigan played a very substantial role in the early research that was used to design crash dummies, but those crash dummies are fifty years old. The population has changed very substantially, and what we\'re doing is taking amazing data about human bodies, collected by very sophisticated medical imaging from real crash subjects. So we\'ve taken that medical data and we\'re providing it for automotive engineers so that they have the tools and information that they need to make safer cars. \r\n<br>\r\nSome of the dummies that are in use today were developed in the 70\'s and early 80\'s. And back then, what it meant to be a 50th percentile male, is much different than what it means to be a 50th percentile male in the year 2017. So what we\'ve tried to do is try to scale things up - supersize the dummies to be more representative of the population. And as the population ages and as the population grows, we want to make sure that the vehicles take that into consideration when they\'re designing their safety systems. \r\n ','2017-09-20 15:21:27','2017-09-20 15:55:03','http://labblog.uofmhealth.org/body-work/car-crash-test-dummies-move-beyond-young-thin-and-male','thumb_new_crash_dummies_model_obese_and_elderly_drivers.png','image/png',182227,'2017-09-20 15:21:27'),(9,'Dr. Wang Introduces Morphomics at Clinical Nutrition Week','Medical imaging is captured in pristine condition while patient response to treatment is progressively observed. Unlike many of the other \"omics\" bio-markers that need to be studied using routinely collected samples that are analyzed and destroyed in the process, these \"natural experiments\" have long been the source of discernment that have cultivated medical advances.','2017-09-20 16:00:29','2017-09-20 16:00:29','https://vimeo.com/154723202','thumb_about_morphomics.png','image/png',198186,'2017-09-20 16:00:29'),(10,'Dateline Detroit: All About Autos','When the first crash test dummies were designed in the 70\'s, engineers could not have predicted changes in the driving population. It wasn\'t envisioned that people would be driving at ages 70s, 80s, and 90s. And as they are, the anatomical differences of an elderly person vary from a younger person. The restraint systems are made for something around a crash test dummy that was of a different size than it is today.\r\n<br>\r\nWhat we\'ve been able to do is to utilize information that is captured with medical imaging from live subjects, and that is the data that we\'ve been providing to Humanetics to give them better insight into how to design dummies that are more appropriate for the current population. ','2017-09-20 16:10:36','2017-09-20 16:10:36','https://vimeo.com/199195200','thumb_dateline_detroit_all_about_autos.png','image/png',214760,'2017-09-20 16:10:35'),(11,'Using Telemetry to Predict Injury Severity (PDF)','dentification of severely injured occupants is of utmost urgency following a crash event. Advanced automatic collision notification (AACN) has great potential to improve post-crash care if the risk of severe injury to a vehicle’s occupants can be accurately predicted. The National Expert Panel for Field Triage set a 20% risk of Injury Severity Score (ISS) 15+ injury [1] as the threshold for urgent transport to a trauma center. The objective of this study was to field test real world performance of the published injury severity prediction (ISP) algorithm in collisions involving recent model GM vehicles equipped with OnStar.\r\nThis study was approved by the IRB of the Michigan Department of Community Health. There were 924 occupants in 836 crash events, involving vehicles equipped with AACN capabilities, in the state of Michigan which were identified from the OnStar records. The police crash report corresponding to the event was identified in the State of Michigan database and used to confirm data sent by telemetry from the vehicle. The injury status of all occupants in the case vehicles was determined. Occupants not transported for medical evaluation were assumed to have ISS<15. For occupants transported from the scene for evaluation and treatment, medical records and imaging data were obtained from the treating facility. Case reviews were conducted to jointly analyze crash, vehicle telemetry, and injury outcome data. The algorithm was used to calculate the predicted risk of injury based on transmitted telemetry data and this prediction was compared to the observed injury outcome for each vehicle as well as each occupant.\r\nIn this field study, the ISP algorithm’s ability to predict whether a vehicle had a seriously injured (ISS>15) occupant was, in terms of sensitivity, at 63.64% compared to the model sensitivity of 39.6% and it also came very close to expectations of specificity at 96.12% compared to the model specificity of 98.3% with use of age and gender data. Without use of age and gender, for ISP calculation, the sensitivity performance was 45.45% while the specificity improved slightly to 97.58%. Detailed analysis of cases suggests that further performance gains could be obtained with more detailed definition of crash direction, seating position, and occupant age.\r\nThere were 184 candidate crash occupants in 167 vehicles not included in the study analysis due to: A) missing Police accident reports, n=77 in 75 crashes; B) inability to retrieve medical records, n = 71 in 61 crashes; or C) rollover event, n=36 in 31 crashes. Analysis of these excluded cases did not reveal any bias in crash severity or injury that would confound the current study findings.\r\nThis study confirms for the first time under real-world field conditions that occupant injury severity can be predicted using vehicle telemetry data. The ISP algorithm’s ability to predict a 20% or greater risk of severe (ISS15+) injury was better than anticipated and confirms ISP’s utility for the field triage of crash subjects. This analysis suggests that AACN technology can greatly facilitate the collection of field data with ISP also serving as a baseline for potential monitoring of the benefits resulting from vehicle safety design changes.','2017-09-20 16:13:30','2017-09-20 16:13:30','http://automotivemedicine.org/pdf/telemetry.pdf','using_telemetry_to_predict_injury_severity.png','image/png',147985,'2017-09-20 16:13:30'),(12,'Seeking Common Ground: UMHS works with Amish and Mennonite communities toward a culturally sensitive approach to burn treatment','When an Amish child is burned, perhaps by liquid in a canning pot or flames in the home\'s wood-burning stove, the family often turns to community healers. These trained men and women apply an ointment that looks like spun honey. In fact, honey is one of its main ingredients, along with olive oil, wormwood, myrrh and other plant-based substances. After the ointment is applied, the wound is wrapped in simmered burdock leaves, which are then secured with gauze. When it\'s time to change the dressings, someone might hum or sing to soothe the child while the leaves are removed piece-by-piece to minimize the pain of an open wound exposed to air. Parents will assist, sometimes holding the scissors or unrolling the gauze. When it comes to burn care, the Amish and similar communities like Old Order Mennonites value gentleness, community and their faith in God\'s will.\r\n<br>\r\nOccasionally, the injury is so severe that a hospital is needed to stabilize the child. In the hospital, burn protocol is different. The patient receives a large dose of pain medication. To maximize speed and efficiency, the dressings are removed all at once. Nurses scrub the wound with soap, water and a washcloth before applying FDA-approved Silvadene, which prevents infection but slows the body\'s healing. This slowing is permitted because patients usually undergo skin grafting: a procedure that provides rapid wound closure, shortens hospital stays and accelerates return to function — outcomes that reflect the values of modern medicine.','2017-09-20 16:26:45','2017-09-20 16:26:45','/seeking_common_ground','seeking_common_ground.png','image/png',77241,'2017-09-20 16:26:45'),(13,'One Man\'s Mission to Make Cars Safer (PDF)','As a trauma surgeon and director of the University of Michigan International Center for Automotive Medicine (ICAM), Stewart Wang, MD, PhD, sees  rsthand the devastating and often fatal injuries that occur every day on our nation’s roadways. After years of operating on the most severely injured crash victims, Dr. Wang was inspired to use his experience to help automakers improve vehicle safety.\r\n<br>\r\nSince 1996, Dr. Wang has invited automotive and safety engineers to the U-M Medical Center monthly to review crash cases along with  rst responders, surgeons, nurses, radiologists, bioengineers, and researchers. In this cooperative venue, the group walks through\r\nthe entire sequence of events for each crash, from the scene and vehicle, to care in the emergency department, medical imaging, procedures performed, injuries and their mechanisms, as well as long-term outcome for the patient.','2017-09-20 16:36:40','2017-09-20 16:47:58','/one_mans_mission_to_make_cars_safer.pdf','in_the_loupes_article.png','image/png',1000476,'2017-09-20 16:36:39');
